import Tile from '../components/tile';
import Coin from '../components/coin';

import '../index.css';

class GameField extends Component {
  render() {
    return (
      <div>
        <Tile className="game-field-tile" />
        <Coin className="game-field-coin" />
      </div>
    );
  }
}

export default GameField;
